-- ----------------------------
--  Table structure for `contract_details`
-- ----------------------------
DROP TABLE IF EXISTS `contract_details`;
CREATE TABLE `contract_details` (
  `details_id` char(32) NOT NULL,
  `cont_id` char(32) NOT NULL,
  `cont_details_date` varchar(10) DEFAULT NULL,
  `cont_amount` decimal(10,0) NOT NULL,
  `cont_status` char(4) NOT NULL,
  `cont_handle_status` char(3) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '000' COMMENT '//合同核销状态-000/应收应付-010/已开票-011/已核销',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`details_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `contract_enclosure`
-- ----------------------------
DROP TABLE IF EXISTS `contract_enclosure`;
CREATE TABLE `contract_enclosure` (
  `enclo_id` char(32) NOT NULL,
  `cont_id` char(32) NOT NULL,
  `enclo_name` varchar(255) DEFAULT NULL,
  `enclo_url` text,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`enclo_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `contract_main`
-- ----------------------------
DROP TABLE IF EXISTS `contract_main`;
CREATE TABLE `contract_main` (
  `cont_main_id` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '/*合同核销id*/',
  `cont_main_type` varchar(30) NOT NULL COMMENT '/*合同核销类型*/',
  `cont_id` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '/*合同id*/',
  `details_id` char(32) NOT NULL COMMENT '/*合同明细id*/',
  `cont_amount` decimal(10,0) NOT NULL COMMENT '/*核销金额*/',
  `budget_id` char(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '/*预算id*/',
  `subject_id_debit` char(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `subject_id_credit` char(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `created_user` char(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`cont_main_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `customer`
-- ----------------------------
DROP TABLE IF EXISTS `customer`;
CREATE TABLE `customer` (
  `cust_id` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `cust_num` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `cust_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `cust_status` int(4) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `cust_phone` varchar(20) DEFAULT NULL COMMENT '/*联系电话*/',
  `cust_fax` varchar(50) DEFAULT NULL COMMENT '/*传真*/',
  `cust_address` varchar(200) DEFAULT NULL COMMENT '/*地址*/',
  `cust_website` varchar(200) DEFAULT NULL COMMENT '/*网站*/',
  `cust_tax_num` varchar(30) DEFAULT NULL COMMENT '/*税号*/',
  `cust_join_time` varchar(10) DEFAULT NULL COMMENT '/*加入时间*/',
  `cust_end_time` varchar(10) DEFAULT NULL COMMENT '/*结束时间*/',
  `cust_remark` text COMMENT '/*备注*/',
  `cust_type` char(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `old_dep` char(32) DEFAULT NULL,
  `old_id` int(10) unsigned NOT NULL,
  `old_type` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`cust_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

