DROP TABLE IF EXISTS `invoice_details`;
CREATE TABLE `invoice_details` (
  `invo_details_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '/*发票明细id*/',
  `invo_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '/*发票集id*/',
  `invo_num` char(8) COLLATE utf8_bin NOT NULL COMMENT '/*发票号码*/',
  `invo_status` char(4) COLLATE utf8_bin DEFAULT NULL COMMENT '/*发票状态*/',
  `invo_write_user` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '/*开票用户*/',
  `invo_write_date` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '/*创建时间*/',
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '/*更新时间*/',
  `invo_class` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '/*发票分组*/',
  `old_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`invo_details_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

