-- ----------------------------
--  Table structure for `invoice_main`
-- ----------------------------
DROP TABLE IF EXISTS `invoice_main`;
CREATE TABLE `invoice_main` (
  `invo_main_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '/*开票数据id*/',
  `invo_num` char(8) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '/*发票号码*/',
  `invo_main_type` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '/*开票业务类型*/-收入-支出',
  `invo_amount` decimal(10,2) NOT NULL COMMENT '/*开票金额*/',
  `invo_text` text CHARACTER SET utf8 COMMENT '/*开票备注*/',
  `invo_parties` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '/*合同方*/',
  `invo_tax_num` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '/*税号*/',
  `invo_cont_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '/*合同明细id*/',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '/*创建时间*/',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '/*更新时间*/',
  PRIMARY KEY (`invo_main_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- ----------------------------
--  Table structure for `node`
-- ----------------------------
DROP TABLE IF EXISTS `node`;
CREATE TABLE `node` (
  `id` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `pid` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `alias` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `sort` tinyint(4) NOT NULL DEFAULT '0',
  `icon` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `is_menu` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_permission` tinyint(1) NOT NULL,
  `status` int(4) NOT NULL DEFAULT '1',
  `is_recycle` tinyint(1) unsigned DEFAULT '0',
  `recycle_name` varchar(60) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `recycle_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

